import React from 'react';
import { useParams } from 'react-router-dom';
import SubHeader from '../components/SubHeader';

const SportPageTemplate = ({ children }) => {
  const { sport } = useParams();
  return (
    <div>
      <SubHeader />
      {children}
    </div>
  );
};

export default SportPageTemplate;
